import { useState } from 'react';
import { Share2, Eye, Plus, Check } from 'lucide-react';
import { motion } from 'framer-motion';

const PlayerCard = ({ player, onCompare, isCompared, onClick }) => {
  const [isHovered, setIsHovered] = useState(false);

  return (
    <motion.div
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      className="bg-white rounded-lg shadow-sm hover:shadow-md transition-all duration-300"
      onMouseEnter={() => setIsHovered(true)}
      onMouseLeave={() => setIsHovered(false)}
    >
      <div className="p-4">
        <div className="relative mb-4">
          <img 
            src={player.image} 
            alt={player.name} 
            className="w-full h-40 object-cover rounded-lg"
          />
          <span className="absolute top-2 left-2 bg-green-400 text-white px-2 py-1 rounded">
            {player.successRate}%
          </span>
          {isHovered && (
            <div className="absolute top-2 right-2 flex space-x-2">
              <button 
                onClick={(e) => {
                  e.stopPropagation();
                  onCompare(player);
                }}
                className="p-2 bg-white rounded-full shadow-md hover:bg-gray-50"
              >
                {isCompared ? <Check size={16} className="text-green-600" /> : <Plus size={16} />}
              </button>
              <button 
                onClick={(e) => {
                  e.stopPropagation();
                  // Share functionality
                }}
                className="p-2 bg-white rounded-full shadow-md hover:bg-gray-50"
              >
                <Share2 size={16} />
              </button>
            </div>
          )}
        </div>

        <div className="mb-4">
          <div className="flex justify-between items-center">
            <div>
              <h3 className="font-bold text-lg">{player.name}</h3>
              <p className="text-gray-500">{player.team}</p>
            </div>
            <span className="text-gray-500">سنة {player.age}</span>
          </div>
        </div>

        <div className="grid grid-cols-3 gap-4 text-center mb-4">
          <div className="group relative">
            <div className="font-bold">{player.matches}</div>
            <div className="text-gray-500 text-sm">المباريات</div>
            <div className="hidden group-hover:block absolute bottom-full left-1/2 transform -translate-x-1/2 bg-black text-white text-xs rounded py-1 px-2 mb-2">
              عدد المباريات في الموسم
            </div>
          </div>
          <div className="group relative">
            <div className="font-bold">{player.successRate}%</div>
            <div className="text-gray-500 text-sm">نسبة النجاح</div>
            <div className="hidden group-hover:block absolute bottom-full left-1/2 transform -translate-x-1/2 bg-black text-white text-xs rounded py-1 px-2 mb-2">
              معدل النجاح في التصديات
            </div>
          </div>
          <div className="group relative">
            <div className="font-bold">{player.cardsCount}</div>
            <div className="text-gray-500 text-sm">بطاقات صفراء</div>
            <div className="hidden group-hover:block absolute bottom-full left-1/2 transform -translate-x-1/2 bg-black text-white text-xs rounded py-1 px-2 mb-2">
              عدد البطاقات الصفراء
            </div>
          </div>
        </div>

        <button 
          onClick={onClick}
          className="w-full bg-green-700 text-white py-2 rounded-md hover:bg-green-800 transition-colors duration-200 flex items-center justify-center"
        >
          <Eye size={16} className="ml-2" />
          عرض الملف
        </button>
      </div>
    </motion.div>
  );
};

export default PlayerCard;
